syntax = "proto2";

package earth.studio.propertyeditor;

option objc_class_prefix = "RTHPE";
option java_multiple_files = true;
option optimize_for = CODE_SIZE;
option java_package = "com.google.android.apps.earth.propertyeditor";

message AllowedTemplateIds {
    repeated string allowed_template_ids = 1;
}
